import React from 'react'
import './folder.scss'

import gympass from '../assets/imagens/gympass.png'

export default function Folder() {
  return (
    <div id='folder'>
      <h2>REDES CONVENIADAS</h2>
      <img src={gympass} alt="" />
    </div>
  )
}
